import React from "react";

const LocationCard = (props) => {
  return (
    <div className="location-info">
      <ul>
        <li>{props.neighborhood}</li>
        <li>{props.address}</li>
        <li>{props.location}</li>
        <li>{props.hours}</li>
      </ul>
    </div>
  );
};

export default LocationCard;
